import React from "react";

import Wrapper from '../components/Header/Wrapper';
import styled from 'styled-components';
import TodoList from "../components/Todos/TodoList";
import Footer from "../components/Footer/Footer";

import {FiTwitter, FiGithub, FiLinkedin, FiSmartphone} from 'react-icons/fi';
import {SiMinutemailer} from 'react-icons/si';
import {VscLocation} from 'react-icons/vsc';

// const ContactPageStyled = styled.div;

const ContactPage=() => {
    return(
        <section id="contactPage">
            <Wrapper>
                <TodoList className="todoListGrid"/>



            <div id="socialMedia">
                <div id="linkedIn">
                <i><FiLinkedin/></i>
                <p className="iconText"><a className="iconText" href="linkedin.com/in/lizkane">linkedin.com/in/lizkane</a></p>
                </div>

                <div id="github">
                <i><FiGithub/></i>
                <p className="iconText"></p>
                </div>

                <div id="twitter">
                <i><FiTwitter/></i>
                <p className="iconText"></p>
                </div>

                <div id="phone">
                <i><FiSmartphone/></i>
                <p className="iconText"></p>
                </div>

                <div id="email">
                <i><SiMinutemailer/></i>
                <p className="iconText"></p>
                </div>

                <div id="location">
                <i><VscLocation/></i>
                <p className="iconText"></p>
                </div>

                {/* <div>
                </>
                <p></p>
                </div> */}

            </div>
            <Footer/>
            </Wrapper>
        </section>
    )
}

export default ContactPage;
